import React, { useState } from "react";
import IITILOGO from "./images/iitilogo.png";

export default function Left() {
  const [style, setStyle] = useState({
   
    textDecoration: "none",
    color: "black",
  lineHeight:"4vh",
  });
  const [style1, setStyle1] = useState({
   
    textDecoration: "none",
    color: "black",
    lineHeight:"4vh",
 
  });
  const [style2, setStyle2] = useState({
    
    textDecoration: "none",
    color: "black",lineHeight:"4vh",
  });
  const [style3, setStyle3] = useState({
    
    textDecoration: "none",
    color: "black",lineHeight:"4vh",
  });

  return (
    <>
      <div className="left d-flex" >
        <div
          className="firstleft d-flex"
          style={{
            flexDirection: "column",
            border: "1px solid black",
            borderRight: "0px solid transparent",
            height: "100vh",
            width: "3rem",
            backgroundColor: "rgb(59 99 139)",
            fontSize: "1.5rem",
          }}
        >
          <a href="#">
            <i
              class="fa-solid fa-qrcode"
              style={style}
              onMouseEnter={() => {
                setStyle({
                  color: "white",
                   lineHeight:"4vh",height:"4vh",
                  textDecoration: "none",
                });
              }}
              onMouseLeave={() => {
                setStyle({
                  color: "black",
             lineHeight:"4vh",
             height:"4vh",
                  textDecoration: "none",
                });
              }}
            ></i>
          </a>
          <a href="#">
            <i
              class="fa-regular fa-user"
              style={style1}
              onMouseEnter={() => {
                setStyle1({
                  color: "white",
                  lineHeight:"4vh",height:"4vh",
                  textDecoration: "none",
                });
              }}
              onMouseLeave={() => {
                setStyle1({
                  color: "black",
                   lineHeight:"4vh",height:"4vh",
                  textDecoration: "none",
                });
              }}
            ></i>
          </a>
          <a href="#">
            <i
              class="fa-regular fa-user"
              style={style2}
              onMouseEnter={() => {
                setStyle2({
                  color: "white",
                  lineHeight:"4vh",height:"4vh",
                  textDecoration: "none",
                });
              }}
              onMouseLeave={() => {
                setStyle2({
                  color: "black",
                lineHeight:"4vh",height:"4vh",
                  textDecoration: "none",
                });
              }}
            ></i>
          </a>
          <a href="#">
            <i
              class="fa-solid fa-table-cells"
              style={style3}
              onMouseEnter={() => {
                setStyle3({
                  color: "white",
                 lineHeight:"4vh",height:"4vh",
                  textDecoration: "none",
                });
              }}
              onMouseLeave={() => {
                setStyle3({
                  color: "black",
lineHeight:"4vh",height:"4vh",
                  textDecoration: "none",
                });
              }}
            ></i>
          </a>
        </div>
        <div
          className="secondleft d-flex"
          style={{
            flexDirection: "column",
            border: "1px solid black",
            borderLeft: "0px solid transparent",
            height: "100vh",
            width: "8rem",
            backgroundColor: "rgb(59 99 139)",
            position: "relative",
            fontSize: "1.5rem",
          }}
        >
          <a
            href="#"
            style={style}
              onMouseEnter={() => {
                setStyle({
                  color: "white",
                   lineHeight:"4vh",
                   height:"4vh",
                  textDecoration: "none",
                });
              }}
              onMouseLeave={() => {
                setStyle({
                  color: "black",
             lineHeight:"4vh",
             height:"4vh",
                  textDecoration: "none",
                });
              }}
          >
            Dashboard
          </a>
          <a
            href="#"
            style={style1}
              onMouseEnter={() => {
                setStyle1({
                  color: "white",
                   lineHeight:"4vh",height:"4vh",
                  textDecoration: "none",
                });
              }}
              onMouseLeave={() => {
                setStyle1({
                  color: "black",
             lineHeight:"4vh",
             height:"4vh",
                  textDecoration: "none",
                });
              }}
          >
            Profile
          </a>
          <a
            href="#"
            style={style2}
              onMouseEnter={() => {
                setStyle2({
                  color: "white",
                   lineHeight:"4vh",height:"4vh",
                  textDecoration: "none",
                });
              }}
              onMouseLeave={() => {
                setStyle2({
                  color: "black",
             lineHeight:"4vh",
             height:"4vh",
                  textDecoration: "none",
                });
              }}
          >
            Enroll
          </a>
          <a
            href="#"
        // 
            style={style3}
              onMouseEnter={() => {
                setStyle3({
                  color: "white",
                   lineHeight:"4vh",height:"4vh",
                  textDecoration: "none",
                });
              }}
              onMouseLeave={() => {
                setStyle3({
                  color: "black",
             lineHeight:"4vh",
             height:"4vh",
                  textDecoration: "none",
                });
              }}
          >
            TimeTable
          </a>
          <div className="logo">
            <img
              src={IITILOGO}
              alt="logo"
              style={{ width: "5rem",bottom:"0px",position:"absolute" }}
            />
          </div>{" "}
        </div>
      </div>
    </>
  );
}
